import React, {Fragment} from 'react';
import { BrowserRouter as Router,Switch,Route } from "react-router-dom";
import Navbar from './components/layout/Navbar';
import Landing from './components/layout/Landing';
import './App.css';

function App() {
  return (
    <div>
      <Router>
        <Fragment>
            <Navbar />
            <Landing />
        </Fragment>
      </Router>
    </div>
  );
}

export default App;
